import React from 'react';
import '../styles/SegmentTwo.css';

export default function SegmentTwo() {
  return (
    <div className="segment-two">
      <article className="primary-content">
        <h1>
          Stay focused on important aspects
        </h1>
        <p>
          JHunt allows you to store, sort, review and change every aspect of your applications in
          one place without a need for you to collect all that information from emails
          , job aggregators
          and you computer.
        </p>
      </article>
    </div>
  );
}
